In this example, we have a data object with a property called names containing four strings. In the template, we use the v-for directive to iterate over the list of names. For each iteration, we display the name and an input element to accept a last name. Additionally, we have a button called "Shuffle" which simply shuffles the list of names. Let's walk through the example step-by-step. Initial Setup First, create a new Vue project or open an existing one. For demonstration purposes, you can use CodeSandbox. <template> <div> <ul> <li v-for="name in names" :key="name"> {{ name }} <input v-model="lastNames[name]" placeholder="Enter last name" /> </li> </ul> <button @click="shuffleNames">Shuffle</button> </div>
</template> <script>
export default { data() { return { names: ['Bruce', 'Clark', 'Diana', 'Barry'], lastNames: { Bruce: '', Clark: '', Diana: '', Barry: '' } }; }, methods: { shuffleNames() { this.names = this.names.sort(() => Math.random() - 0.5); } }
};
</script> Observing the Bug Refresh the page. Enter last names for some of the names, such as "Bruce Wayne" and "Clark Kent". Click the "Shuffle" button. Notice that while the names are shuffled, the last names do not shuffle accordingly. This results in mismatched names and last names, such as "Barry Wayne" and "Clark Kent". This behavior occurs because Vue patches the data in each element rather than changing the node completely, due to the absence of the key attribute. Correcting the Issue with Key Attribute To resolve this issue, we add the key attribute to our v-for directive, binding it to a unique value in each iteration. <template> <div> <ul> <li v-for="name in names" :key="name"> {{ name }} <input v-model="lastNames[name]" placeholder="Enter last name" /> </li> </ul> <button @click="shuffleNames">Shuffle</button> </div>
</template> <script>
export default { data() { return { names: ['Bruce', 'Clark', 'Diana', 'Barry'], lastNames: { Bruce: '', Clark: '', Diana: '', Barry: '' } }; }, methods: { shuffleNames() { this.names = this.names.sort(() => Math.random() - 0.5); } }
};
</script> After adding the key attribute, repeat the steps to observe the corrected behavior: Refresh the page. Enter last names for some of the names. Click the "Shuffle" button. Now, the last names shuffle along with the names as expected.

