In this tutorial, we explored how to conditionally render a list of elements in Vue.js 3. We learned why combining v-for and v-if directly is discouraged and demonstrated two solutions: using computed properties and using the <template> tag. By following these best practices, we can ensure efficient and error-free rendering in our Vue.js applications. In the next tutorial, we will start learning about methods in Vue.js. Stay tuned for more advanced topics. export default { data() { return { names: ['Bruce', 'Clark', 'Diana'] } }, computed: { filteredNames() { return this.names.filter(name => name === 'Bruce'); } }
} <template> <div> <h2 v-for="(name, index) in filteredNames" :key="index"> {{ name }} </h2> </div>
</template> <template> <div> <template v-for="(name, index) in names" :key="index"> <h2 v-if="name === 'Bruce'"> {{ name }} </h2> </template> </div>
